import './App.css';
import CustomNavbar from './components/Navbar';
import Karte from "./components/Karte";
import TagSlide from './components/TagSlide';
// import Sandwichmenu from "./components/Sandwichmenu";

function App() {
  return (
    <>
      <CustomNavbar />
      <TagSlide/>
      <Karte />
      {/* <Sandwichmenu /> */}
    </>
  );
}

export default App;
